        default: Date.now()
    },
    city: {
        type: String,
        required: true
    },
    street: {
        type: String,
        required: true
    }
});
export const Post = mongoose.model("Post", postSchema);

export function validatePost(post) {
    const schema = {
        title: Joi.string()
            .min(3)
            .max(50)
            .required(),
        content: Joi.string().required()
    };
    return Joi.validate(post, schema);
}

